StackExchange.ready(function() {
            $(".js-tag-filter").typeWatch({ highlight:true, wait:500, captureLength: -1, callback: finished });
            
        });

        var request = null;
        function finished(txt) {
            if (request) { request.abort(); }
            request = $.ajax({
                type: "POST",
                url: "/filter/tags-for-index",
                data: { 
                    filter: txt, 
                    tab: 'Popular',
                    namesOnly: $('.js-names-only').length > 0 ? $('.js-names-only').is(':checked') : false,
                    fkey: StackExchange.options.user.fkey 
                },
                dataType: "html",
                success: function (result) {
                    var domelement = $(result);
                    $("#tags_list > *").remove();
                    $("#tags_list").prepend(domelement);

                    if (txt == "") {
                        $(".pager").show();
                    } else
                    {
                        $(".pager").hide();
                    }

                }
            });
        }

StackExchange.ready(function() {

                var ga3Settings = {
                    autoLink: ["stackoverflow.blog","info.stackoverflowsolutions.com","stackoverflowsolutions.com"],
                    sendTitles: true,
                    tracker: window.ga,
                    trackingCodes: [
                        'UA-108242619-1'
                    ],
                    checkDimension: 'dimension42'
                                                    };

                var customGA4Dimensions = {};


                var ga4Settings = {
                    tracker: gtag,
                    trackingCodes: [
                        'G-WCZ03SZFCQ'
                    ],
                    consentsToPerformanceCookies: "denied",
                    consentsToTargetingCookies: "denied",
                    eventParameters: customGA4Dimensions,
                    checkForAdBlock: true
                };

                StackExchange.ga.init({ GA3: ga3Settings, GA4: ga4Settings });




                StackExchange.ga.setDimension('dimension3', 'Tags/List');


                StackExchange.ga.setDimension('dimension7', "1686683849.938844759");

                StackExchange.ga.trackPageView();
            });
